import './App.css';

class Home extends React.Component {
    render() {
      return (
        <div>
          <div>
            <h1>Home</h1>
            <button type="button"> Try it 
            <a href={"https://www.google.com"}> </a>
            </button>
          </div>
        </div>
      );
    }
  }

  export default Home;
